import React from 'react'
import {Row, Col } from 'react-bootstrap'
import {Tematicas} from '../data/tematicas'

export const Dps = () => {

    //console.log(Tematicas);

    return (
        <Row>
            <Col id="main" xs={{span:10, offset: 1}} >
            {
                Tematicas.map(tematica => (
                     <div key={tematica.Url}>
                         {tematica.Titulo}
                    </div>
                ))
            }
            </Col>
        </Row>
    )
}


